import React, { useState, useEffect } from 'react'

const ScheduleBooking = () => {
    const [data, setData] = useState([]);

    const generateDates = () => {
        const today = new Date();
        const generatedDates = [];

        for (let i = 0; i < 31; i++) {
            const nextDay = new Date(today);
            nextDay.setDate(today.getDate() + i);
            generatedDates.push(nextDay.toLocaleDateString());
        }

        setData(generatedDates);
    };

    // Call the generateDates function when the component mounts or whenever needed
    useEffect(() => {
        generateDates();
    }, []); // Empty dependency array ensures the function is only called once when the component mounts


    return (
        <div className='d-flex justify-content-center flex-column mt-5'>
            <div className='d-flex  '>
                <h1>Appointment Booking</h1>
            </div>
            <div>
                {data}
                <button onClick={generateDates()}></button>
            </div>
        </div>
    )
}

export default ScheduleBooking
